INSERT INTO `trinity_string` VALUES (542144, '|cfff00000[Information. SPP Server]:|r Gold coin of valor: you can get these coins by special quests and server events. Decency points: when you get bans you get 1 decency point. Each one decency point reduce count of gained Gold coin of valor. 1 decency point = 10% reduce gained Gold coins of valor. Maximum reduce is 50%. Decency is activated when this bonus system is release on live servers, so you get decency points by bans also only after release. How you can remove decency point from your character? Is no way right now. Prices in vendor: all prices can change at any time and later will be balanced and calculate by count of daily quests etc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[.  . v1.01]:|r   :          . :        1   .          . 1  = 10%   .   - 50%.          ,             .      ?    .   :                  ,   ..', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542145, '|cfff00000[Information. Support in Warsong]:|r Take a %s and find injured fighters on battleground. When you find injured fighter take him and go back on your base. Use vehicle abilities for attack, defence and take a fighters. For each one saved injured fighter you receive 1 stack of bonus aura. When you finish save event go to Commanders Payne table and use it for exchange 1 stack of bonus aura for 1 Gold coins of valor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[.     .]:|r  %s      .    ,        .     ,    .        1   .    ,           1    1   .', NULL, NULL);
